    false,nt"url": null,nt"notes": "This narrative report for Des Lacs and
    Lostwood Migratory Waterfowl Refuges outlines Refuge accomplishments from May through
    July of 1938. The report begins by summarizing the weather conditions, habitat conditions,
    and water conditions during this period. Wildlife- including migratory birds and
    disease- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. A progress report on field investigations and
    applied research is also provided. N-R forms and photographs are attached.",nt"owner_org":
